import './App.css';
import {Route,Routes,Link} from 'react-router-dom';
import FrontPage from './Components/FrontPage';

import AddMeet from './Components/AddMeet';
import ShowPage from './Components/ShowPage';
function App() {
  return (
    <div>
      <navbar className="nav-link">
        <Link to="/"><div className='logo'><h3><i class="bi bi-window-dock"></i><span className='logo-head'> V-Meet</span></h3></div></Link>
        <div>
          <ul className='ul-link'>
            <Link to="/"><li>Home</li></Link>
            <Link to="your-meet"><li>Meeting</li></Link>
            <Link to="add-meet"><li>Add Meeting</li></Link>
          </ul>
        </div>
      </navbar>
      <FrontPage/>

      <AddMeet/>
      <ShowPage/>

      <Routes>
        <Route path="/" ></Route>
      </Routes>
    </div>
  );
}

export default App;
